const ReceivedSelect = () => {
    return(
        <div>
            <select onChange = {props.friendReact}>
                <option value = "Accept">Accept</option>
                <option value = "Decline">Decline</option>
                <option value = "Block">Block</option>
            </select>
        </div>
    )
}

export default ReceivedSelect;
